function Videos() {
  return (
    <div>
      <h1>Our Favorite Videos</h1>
      <iframe width="560" height="315" src="https://www.youtube.com/embed/dQw4w9WgXcQ" title="Video 1" frameBorder="0" allowFullScreen></iframe>
      <iframe width="560" height="315" src="https://www.youtube.com/embed/9bZkp7q19f0" title="Video 2" frameBorder="0" allowFullScreen></iframe>
    </div>
  );
}

export default Videos;
